import React from "react";
import Slider from "react-slick";

const Testimonials = () => {
    return (
    <Slider>
        <section class="responsive slider slick-initialized slick-slider slick-dotted">
            <button className="slick-prev- slick-arrow" aria-label="Previous" type="button" aria-disabled="false">
            
            </button>
            
        </section>

    </Slider>
    );

};
export default Testimonials;
